import React from "react";
// import "./styles.css";
import "./styles.css"

const Home = () => {
  return (
    <main className="home">
      <h2>Welcome to Foodies Hub!</h2>
      <p>Explore our delicious menu and order your favorites today!</p>
      <section className="featured">
        <h3>Featured Dishes</h3>
        <div className="dishes">
          <div className="dish">
            <img src="https://images.unsplash.com/photo-1586190848861-99aa4a171e90?fit=crop&w=500&q=60" alt="Dish" />
            <p>Grilled Chicken</p>
          </div>
          <div className="dish">
            <img src="https://via.placeholder.com/150" alt="Dish" />
            <p>Veggie Pizza</p>
          </div>
        </div>
      </section>
    </main>
  );
};

export default Home;
